import React from 'react';

const Header = ({ activeTab, onTabChange, modelStatus }) => {
  const tabs = [
    { id: 'dashboard', label: 'Dashboard', icon: 'üìä' },
    { id: 'predict', label: 'Predict', icon: 'üîÆ' },
    { id: 'status', label: 'Model Status', icon: '‚öôÔ∏è' }
  ];

  return (
    <header className="bg-white shadow-sm border-b border-gray-200">
      <div className="container mx-auto px-4">
        <div className="flex items-center justify-between h-16">
          {/* Logo and Title */}
          <div className="flex items-center space-x-3">
            <div className="w-10 h-10 bg-gradient-to-br from-primary-500 to-secondary-500 rounded-lg flex items-center justify-center">
              <span className="text-white text-xl font-bold">AQ</span>
            </div>
            <div>
              <h1 className="text-xl font-bold text-gray-900">Air Quality Prediction</h1>
              <p className="text-sm text-gray-600">ML-powered pollutant forecasting</p>
            </div>
          </div>

          {/* Navigation Tabs */}
          <nav className="flex space-x-1">
            {tabs.map((tab) => (
              <button
                key={tab.id}
                onClick={() => onTabChange(tab.id)}
                className={`px-4 py-2 rounded-lg font-medium transition-all duration-200 flex items-center space-x-2 ${
                  activeTab === tab.id
                    ? 'bg-primary-100 text-primary-700 border border-primary-200'
                    : 'text-gray-600 hover:text-gray-900 hover:bg-gray-100'
                }`}
              >
                <span>{tab.icon}</span>
                <span>{tab.label}</span>
              </button>
            ))}
          </nav>

          {/* Model Status Indicator */}
          <div className="flex items-center space-x-3">
            <div className="flex items-center space-x-2">
              <div className={`w-3 h-3 rounded-full ${
                modelStatus.isLoaded ? 'bg-green-500' : 'bg-red-500'
              }`}></div>
              <span className="text-sm text-gray-600">
                {modelStatus.isLoaded ? 'Model Ready' : 'Model Not Ready'}
              </span>
            </div>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
